import React from 'react';
import DatasetStats from './components/DatasetStats';
import GammaStatistics from './components/GammaStatistics';
import dataset from './dataset.json';

function App() {
  return (
    <div className="App">
      <h2 style={{justifyContent:'center', display:'flex'}}>Class-wise Mean, Median, Mode of
“Flavanoids” for the entire dataset.</h2>
      <div style={{justifyContent:'center', display:'flex'}}>
      <DatasetStats  />
      </div>

        <h2 style={{justifyContent:'center', display:'flex'}}>The Class-Wise Mean, Median, Mode of “Gamma” for the
entire dataset.</h2>
<div style={{justifyContent:'center', display:'flex'}}>
      <GammaStatistics data={dataset} />
      </div>
    </div>
  );
}

export default App;
